const _hoisted_7 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>True Name: Florence Nightingale (Santa)</li><li>Class: Archer</li><li>Source: Historical fact</li><li>Region: Europe</li><li>Gender: Female</li><li>Alignment: Lawful Good</li><li>Height: 165 cm</li><li>Weight: 52 kg</li></ul><p><strong>Meta</strong></p><ul><li>Character Creator: Sakurai Hikaru</li><li>Character Design: Takahashi Keitarou</li><li>Character Voice: Sawashiro Miyuki</li><li>Appearance in Main Works: Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">D+</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">B+</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">B+</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">D+</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">A+</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">B</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Magic Resistance: [C]</strong></p><p>Negates spells with a chant of two verses or less.</p><p>Cannot defend against something more complex, like high magecraft or ritual curses.</p><p><strong>Independent Action: [A+]</strong></p><p>The ability to sustain herself for a while even if the mana supply from the Master is severed.</p><p>For the sake of her mission, she can fight alone.</p><p><strong>Mad Enhancement: [EX]</strong></p><p>Ranks up all parameters but deprives her of most of her sanity.</p><p>It\u2019s unknown if this property was carried over from her original Berserker Saint Graph or if it was kept as a unique trait of the Heroic Spirit Nightingale.</p><p>She speaks slightly more tenderly than when she was a Berserker, but her basic conversation style hasn\u2019t changed all that much.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Assault Medicine: [C+]</strong></p><p>It&#39;s not a gun.</p><p>It is medicine.</p><p>The gun-like syringe owned by Archer Nightingale injects a variety of ampoules containing drugs with different effects by shooting them like a long-range weapon. It fires at 20 shots per second.</p><p>With a direct hit, the nursing/treatment subject will be healed in a matter of seconds.</p><p>With a direct hit, the sterilization/disinfection subject will be eradicated.</p><p>It\u2019s a constantly active Noble Phantasm, but it\u2019s displayed as a Skill in-game.</p><p><strong>Nurse of Steel (Christmas): [A+]</strong></p><p>An altered version of the Nurse of Steel Skill she has as a Berserker.</p><p>The Bell the Angel Rings in the Holy Night: EX</p><p>Archer Nightingale shows very little interest in the actual event of Christmas, but her modus operandi is deeply connected to the Holy Night.</p><p>Her scarlet costume and the golden bell fastened to her traveling bag are proof of that.</p><p>Still, she herself has no clue where those came from, she just was like that before she noticed.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="assault-medicine-fullburst-party-the-angel-yells-and-the-devil-disappears-into-the-shadows" tabindex="-1"><a class="header-anchor" href="#assault-medicine-fullburst-party-the-angel-yells-and-the-devil-disappears-into-the-shadows" aria-hidden="true">#</a> Assault Medicine Fullburst Party (The angel yells, and the devil disappears into the shadows)</h1><ul><li>Rank: B</li><li>Type: Anti-Army Noble Phantasm</li><li>Range: 0-60</li><li>Max. Targets: 50 people</li></ul><p>A full-force raid using Archer Nightingale\u2019s gun-like syringe: The Noble Phantasm Assault Medicine.</p><p>It gets rid of all inadmissible pathogens instantly and cures all the sick and wounded in need of treatment instantly.</p><h1 id="assault-medicine-the-angel-s-drips-the-devil-s-tears" tabindex="-1"><a class="header-anchor" href="#assault-medicine-the-angel-s-drips-the-devil-s-tears" aria-hidden="true">#</a> Assault Medicine (The angel\u2019s drips, the devil\u2019s tears)</h1><ul><li>Rank: C+</li><li>Type: Anti-Unit Noble Phantasm</li><li>Range: 0-30</li><li>Max. Targets: 10 people</li></ul><p>Nightingale\u2019s spirit and will to get rid of all inadmissible pathogens and cure all the sick and wounded in need of treatment, abstracted as a sniper Noble Phantasm.</p><p>A Constantly Active Noble Phantasm.</p><p>We assume it takes a form similar to a gun due to the influence of her military experience.</p><p>It\u2019s displayed as a Skill in-game.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><p>First-person pronoun: Watashi</p><p>Second-person pronoun: Anata/Name-san/Mister Name/Miss Name</p><p>Third-person pronoun: Kare/Kanojo/Name-san/Mister Name/Miss Name</p><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>The Angel of Crimea, who takes duty and devotion as her creed.</p><p>A conviction of steel. One who saves people. The Little War Office.</p><p>Her character is almost the same when she\u2019s a Berserker, but...</p><p>Wonky logic and treatment regardless of consent.</p><p>That part is still is the exact same as the regular Nightingale. However...</p><p>Upon closer inspection, her words are slightly more graceful than usual.</p><p>While not frequently, you may even see her talking like a dreamer.</p><p>Archer Nightingale has her mentality mixed with the mentality of the younger Nightingale, the one from before she experienced nursing and medical care firsthand. For that reason, she&#39;s minutely more inclined to use phrasings and expressions that evidence her wealthy background.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>She wishes all the candy in the world would turn into medicine (like sweet cold remedies).</p><p>Also that Christmas should be changed into a holiday that celebrates the healing of wounds and ailments.</p><p>But she would never a cast a wish upon the Holy Grail for it.</p><p>Archer Nightingale wants to do it herself.</p><p>If you ask her \u201CIsn\u2019t it supposed to be \u2018I wish all medicine in the world would turn to candy\u2019?\u201D, her answer would be \u201CWhat\u2019s the point? Of turning medicine? Into candy?\u201D.</p><p>She\u2019s not any willing to back down about this particular detail.</p><p>\u201CCandy turning into medicine is a thing that dreams are made of. But medicine must remain as medicine\u201D.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>&quot;Nice to meet you. How do you do? Any issues with your health?&quot;</p><p>&quot;No, I am not an angel. Please refrain from repeating the same misinformation.&quot;</p><p>&quot;Excuse me, it&#39;s time for your treatment.&quot;</p><p>&quot;Never forget to wash your hands and rinse your mouth. Are we understood?&quot;</p><p>&quot;Disinfection, sterilization, pasteurization!&quot;</p><h2 id="character-1" tabindex="-1"><a class="header-anchor" href="#character-1" aria-hidden="true">#</a> Character</h2><p>Almost the same as Nightingale(Berserker).</p><p>She carries a large firearm that looks like a rifle but also like an umbrella, and her class was changed to Archer.</p><p>Judging by the key red tone in her outfit, she\u2019s a Santa Servant, apparently\u2026(?)</p><p>\u2662</p><p>The reason for this Saint Graph alteration was Nursery Rhyme&#39;s meddling.</p><p>After a series of incidents, Archer Nightingale accepted the child she once was and will then do her job as a new Santa Servant.</p><p>More specifically...</p><p>All while praying in the Holy Night, she will...</p><p>Fight to improve nursing and hygiene, and defeat all illnesses.</p><p>It&#39;s the same as always...?</p><p>That may be right, but it also may not be.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>All Servants</strong></p><p>Nightingale perceives all Servants as &quot;soldiers&quot;.</p><p>They get injured often.</p><p>In other words, they are nursing patients.</p><p><strong>Enemies</strong></p><p>Whoever attacks her is an enemy soldier, but they are also lives to be saved.</p><p>She must first incapacitate them or else she won&#39;t be able to treat them or nurse them.</p><p><strong>Caligula/Phantom/Gilles (Caster)/Salome/Salieri/Mori Nagayoshi/Baobhan Sith</strong></p><p>The mentally ill are nursing patients too.</p><p><strong>Monte Cristo</strong></p><p>He&#39;ll need some nursing in the special ward.</p><p>Ah, he&#39;s escaping again! Mister!</p><p>Hold it right there. Mister!</p><p><strong>Ashiya Douman</strong></p><p>Stop.</p><p>It seems you need nursing in the special ward.</p><p>Hurry!</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>When I received the commission for Nightingale (Santa), I was requested to make multiple versions. This Mary Poppins-style Santa was chosen among 3 drafts. I talked to them about wanting to draw the other forms, and as result, I got to draw the nurse version from the candidates in the Final Ascension. (Takahashi Keitarou)</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p>(Lib will add after publish)</p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 107);
